import React from 'react';
import './footer.css';
import {Container, Row, Col, ListGroup, ListGroupItem} from 'reactstrap';
import {Link} from 'react-router-dom'; 
import logo from '../../assets/images/logo.png';

const quick__links = [
  {
    Path: '/home',
    display: 'Home'
  },
  {
    Path: '/about',
    display: 'About'
  },
  {
    Path: '/tours',
    display: 'Tours'
  },
]

const quick__links2 = [
  {
    Path: '/gallery',
    display: 'Gallery'
  },
  {
    Path: '/login',
    display: 'Login'
  },
  {
    Path: '/register',
    display: 'Register'
  },
]

const Footer = () => {
  return  <Footer>
  <Container>
    <Row>
      <Col lg='3'>
        
      </Col>

      <Col lg='3'>
        <div className="footer__link-title">Discover</div>

        <ListGroup className="footer__quick-links">
          {
            quick__links.map((item,index)=>(
              <ListGroupItem key={index} className='ps-0 border-0' >
                <Link to={item.Path}>{item.display}</Link>
              </ListGroupItem>
            ))
          }
        </ListGroup>
       </Col>
      <Col lg='3'></Col>
      <Col lg='3'></Col>
    </Row>
  </Container>
</Footer>
}

export default Footer
